	public void setExceptionMatcher(String language) {
		switch (language) {
		case "java":
			em = JavaExceptionMatcher.getInstance();
			break;
		case "prolog":
			em = PrologExceptionMatcher.getInstance();
			break;
		case "python":
			em = JavaExceptionMatcher.getInstance();
			break;
		case "SML":
			em = SMLExceptionMatcher.getInstance();
			break;
		default:
			em = JavaExceptionMatcher.getInstance();
			break;
		}
	}

